import React from "react"

const Square = (props) => {
  return (
    <>

        <table>
              {props.board.map((value) => {
                return (
                  <>
                  <div className="square">
                    {value}
                  </div>
                  </>
                )
              })}
        </table>

    </>
  )
}
export default Square
